$_MODULE['<{braintreeofficial}prestashop>migrationstepone_72971f1f65887708cb1ede9887cf021d'] = 'A partir de julio de 2019, la solución de pago Braintree fue separada del módulo de PayPal. Actualmente se está utilizando Braintree a través del módulo PayPal. Puede migrar rápidamente sus configuraciones de Braintree haciendo clic en el botón \"Importar configuración\" en el botón debajo. Nosotros podemos migrar todas tus configuraciones actuales, solo deberás agregar la KEY pública y la KEY privada para finalizar la configuración de su cuenta.';
