$_MODULE['<{braintreeofficial}prestashop>migrationstepone_2d97d84303c58d86ae505ff244c6d6b7'] = 'El antiguo módulo de PayPal se desactivará automáticamente después de la migración. Le pedimos amablemente que desinstale el módulo Paypal una vez que haya completado las verificaciones y reciba algunos pedidos nuevos a través del nuevo módulo Braintree.';
